    return ( 
        <div className="services__inner-item">
        <a className="services__inner-link" href="">
          <h3 className="services__item-title">Терапия</h3>
          <div className="services__item-box">
            <span className="services__item-num">26 услуг</span>
            {/* <img className="services__item-img" src={therapy} alt="" /> */}
          </div>
        </a>
      </div>
     );
}
 
export default Services;
